step: 1,\n            connect: "lower",\n            range: {\n                ''min'': [1],\n                ''max'': [20]\n            }\n        });\n        $(''#n_neighbors-slider'').Link(''lower'').to($(''#n_neighbors-value''));\n        $(''#n_neighbors-slider'').Link(''lower'').to($(''#n_neighbors''));\n\n        $(''#leaf_size-slider'').noUiSlider({\n            start: [30],\n            step: 1,\n            connect: "lower",\n            range: {\n                ''min'': [1],\n                ''max'': [50]\n            }\n        });\n        $(''#leaf_size-slider'').Link(''lower'').to($(''#leaf_size-value''));\n        $(''#leaf_size-slider'').Link(''lower'').to($(''#leaf_size''));\n\n\n        $("#q1").qtip({\n            content: {\n                text: ''Algorithm used to compute the nearest neighbors.'',\n                title:''<i>algorithm</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q2").qtip({\n            content: {\n                text: ''Weight function used in prediction.'',\n                title:''<i>weights</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q3").qtip({\n            content: {\n                text: ''Number of neighbors to use by default for k_neighbors queries.'',\n                title:''<i>n_neighbors</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q4").qtip({\n            content: {\n                text: ''The distance metric to use for computing closest neighbors. The default metric is minkowski, and with p=2 is equivalent to the standard Euclidean metric.'',\n                title:''<i>metric</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q5").qtip({\n            content: {\n                text: ''Leaf size passed to BallTree or KDTree. This can affect the speed of the construction and query, as well as the memory required to store the tree. The optimal value depends on the nature of the problem.'',\n                title:''<i>leaf_size</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n    });\n</script>', '<h4 class="m-b-xxs text-center">K-Nearest Neighbor Classifier <i class=\n    "fa fa-connectdevelop"></i></h4>\n\n    <p>In k-NN classification, an instance is classified by a majority vote of\n    its neighbors, being assigned to the class most common\n    among its <i>k</i> nearest neighbors .<a href=\n    "http://en.wikipedia.org/wiki/K-nearest_neighbors_algorithm" target=\n    "_blank">[ref]</a></p>\n\n    <div class="col-xs-6">\n        <div>\n            <span>Complexity</span> <small class="pull-right">2/10</small>\n        </div>\n\n        <div class="progress progress-small">\n            <div class="progress-bar" style="width: 20%;">\n            </div>\n        </div>\n    </div>\n\n    <div class="col-xs-6">\n        <div>\n            <span>Interpretability</span> <small class=\n            "pull-right">9/10</small>\n        </div>\n\n        <div class="progress progress-small">\n            <div class="progress-bar" style="width: 90%;"></div>\n        </div>\n    </div>'),
(5, 'classification', '{"penalty":"string","C":"float","fit_intercept":"bool","intercept_scaling":"float","max_iter":"int", "random_state":"int","solver":"string","tol":"float"}', 'Logistic Regression', '<div class="row">\n    <div class="col-lg-2">\n        <label>Penalty: <i class="fa fa-question-circle" id="q1" style=\n                "color:#676a6c"></i></label>\n\n        <div class="radio i-checks">\n            <label><input checked class="required" name="penalty" type=\n                    "radio" value="l1"> L1</label>\n        </div>\n\n        <div class="radio i-checks">\n            <label><input class="required" name="penalty" type="radio"\n                          value="l2"> L2</label>\n        </div>\n	    <br>\n	    <label>fit_intercept: <i class="fa fa-question-circle" id="q2" style=\n                "color:#676a6c"></i></label>\n\n        <div class="radio i-checks">\n            <label><input checked class="required" name="fit_intercept" type=\n                    "radio" value="1"> True</label>\n        </div>\n\n        <div class="radio i-checks">\n            <label><input class="required" name="fit_intercept" type="radio"\n                          value="0"> False</label>\n        </div>\n    </div>\n\n    <div class="col-lg-2">\n        <label>Solver: <i class="fa fa-question-circle" id="q3" style=\n        "color:#676a6c"></i></label>\n\n        <div class="radio i-checks">\n            <label><input checked class="required" name="solver" type="radio"\n            value="newton-cg"> newton-cg</label>\n        </div>\n\n\n        <div class="radio i-checks">\n            <label><input class="required" name="solver" type="radio" value=\n            "lbfgs"> lbfgs</label>\n        </div>\n\n\n        <div class="radio i-checks">\n            <label><input class="required" name="solver" type="radio" value=\n            "linear"> linear</label>\n        </div>\n    </div>\n\n    <div class="col-lg-4 text-center">\n        <div class="row text-center">\n            <label>C = <span class="example-val" id="C-value" style=\n            "color:#1AB394"></span> <i class="fa fa-question-circle" id="q4"\n            style="color:#676a6c"></i></label>\n\n            <div class="col-lg-10 col-lg-offset-1">\n                <div id="C-slider">\n                </div>\n                <input id="C" name="C" type="hidden" value="">\n            </div>\n        </div>\n        <br>\n\n\n        <div class="row text-center">\n            <label>intercept_scaling = <span class="example-val" id=\n            "intercept_scaling-value" style="color:#1AB394"></span> <i class=\n            "fa fa-question-circle" id="q5" style="color:#676a6c"></i></label>\n\n            <div class="col-lg-10 col-lg-offset-1">\n                <div id="intercept_scaling-slider">\n                </div>\n                <input id="intercept_scaling" name="intercept_scaling" type=\n                "hidden" value="">\n            </div>\n        </div>\n        <br>\n\n         <div class="row text-center">\n            <label>max_iter = <span class="example-val" id=\n            "max_iter-value" style="color:#1AB394"></span> <i class=\n            "fa fa-question-circle" id="q6" style="color:#676a6c"></i></label>\n\n            <div class="col-lg-10 col-lg-offset-1">\n                <div id="max_iter-slider">\n                </div>\n                <input id="max_iter" name="max_iter" type=\n                "hidden" value="">\n            </div>\n        </div>\n    </div>\n\n\n    <div class="col-lg-4 text-center">\n        <div class="row text-center">\n            <label>random_state = <span class="example-val" id="random_state-value"\n            style="color:#1AB394"></span> <i class="fa fa-question-circle" id=\n            "q7" style="color:#676a6c"></i></label>\n\n            <div class="col-lg-10 col-lg-offset-1">\n                <div id="random_state-slider">\n                </div>\n                <input id="random_state" name="random_state" type="hidden" value="">\n            </div>\n        </div>\n        <br>\n\n        <div class="row text-center">\n            <label>tol = <span class="example-val" id="tol-value"\n            style="color:#1AB394"></span> <i class="fa fa-question-circle" id=\n            "q8" style="color:#676a6c"></i></label>\n\n            <div class="col-lg-10 col-lg-offset-1">\n                <div id="tol-slider">\n                </div>\n                <input id="tol" name="tol" type="hidden" value="">\n            </div>\n        </div>\n    </div>\n</div>\n<script>\n    $(document).ready(function() {\n        $(''.i-checks'').iCheck({\n            checkboxClass: ''icheckbox_square-green'',\n            radioClass: ''iradio_square-green'',\n        });\n\n        $(''#C-slider'').noUiSlider({\n            start: [1],\n            step: 0.1,\n            connect: "lower",\n            range: {\n                ''min'': [0.1],\n                ''max'': [10]\n            }\n        });\n        $(''#C-slider'').Link(''lower'').to($(''#C-value''));\n        $(''#C-slider'').Link(''lower'').to($(''#C''));\n\n        $(''#intercept_scaling-slider'').noUiSlider({\n            start: [1],\n            step: 0.1,\n            connect: "lower",\n            range: {\n                ''min'': [0.1],\n                ''max'': [10]\n            }\n        });\n        $(''#intercept_scaling-slider'').Link(''lower'').to($(''#intercept_scaling-value''));\n        $(''#intercept_scaling-slider'').Link(''lower'').to($(''#intercept_scaling''));\n\n        $(''#max_iter-slider'').noUiSlider({\n            start: [100],\n            step: 1,\n            connect: "lower",\n            range: {\n                ''min'': [1],\n                ''max'': [1000]\n            }\n        });\n        $(''#max_iter-slider'').Link(''lower'').to($(''#max_iter-value''));\n        $(''#max_iter-slider'').Link(''lower'').to($(''#max_iter''));\n\n        $(''#random_state-slider'').noUiSlider({\n            start: [1],\n            step: 1,\n            connect: "lower",\n            range: {\n                ''min'': [1],\n                ''max'': [100]\n            }\n        });\n        $(''#random_state-slider'').Link(''lower'').to($(''#random_state-value''));\n        $(''#random_state-slider'').Link(''lower'').to($(''#random_state''));\n\n        $(''#tol-slider'').noUiSlider({\n            start: [1],\n            step: 0.1,\n            connect: "lower",\n            range: {\n                ''min'': [0.1],\n                ''max'': [10]\n            }\n        });\n        $(''#tol-slider'').Link(''lower'').to($(''#tol-value''));\n        $(''#tol-slider'').Link(''lower'').to($(''#tol''));\n\n\n        $("#q1").qtip({\n            content: {\n                text: ''Used to specify the norm used in the penalization. The newton-cg and lbfgs solvers support only l2 penalties.'',\n                title:''<i>Penalty</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q2").qtip({\n            content: {\n                text: ''Specifies if a constant (a.k.a. bias or intercept) should be added the decision function.'',\n                title:''<i>fit_intercept</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q3").qtip({\n            content: {\n                text: ''Algorithm to use in the optimization problem.'',\n                title:''<i>Solver</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q4").qtip({\n            content: {\n                text: ''Inverse of regularization strength; must be a positive float. Like in support vector machines, smaller values specify stronger regularization.'',\n                title:''<i>c</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q5").qtip({\n            content: {\n                text: ''Useful only if solver is liblinear. when self.fit_intercept is True, instance vector x becomes [x, self.intercept_scaling], i.e. a “synthetic” feature with constant value equals to intercept_scaling is appended to the instance vector. The intercept becomes intercept_scaling * synthetic feature weight Note! the synthetic feature weight is subject to l1/l2 regularization as all other features. To lessen the effect of regularization on synthetic feature weight (and therefore on the intercept) intercept_scaling has to be increased.'',\n                title:''<i>intercept_scaling</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q6").qtip({\n            content: {\n                text: ''Useful only for the newton-cg and lbfgs solvers. Maximum number of iterations taken for the solvers to converge.'',\n                title:''<i>max_iter</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q7").qtip({\n            content: {\n                text: ''The seed of the pseudo random number generator to use when shuffling the data.'',\n                title:''<i>random_state</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n        $("#q8").qtip({\n            content: {\n                text: ''Tolerance for stopping criteria.'',\n                title:''<i>tol</i>''\n            },\n            style: { classes: ''qtip-rounded qtip-shadow qtip-cream'' }\n        });\n    });\n</script>', '<h4 class="m-b-xxs text-center">Logitic Regression <i class=\n"fa fa-superscript"></i></h4>\n\n\n<p>Logistic regression measures the relationship between the categorical\ndependent variable and one or more independent variables, which are usually\n(but not necessarily) continuous, by estimating probabilities. <a href=\n"http://en.wikipedia.org/wiki/Logistic_regression" target=\n"_blank">[ref]</a></p>\n\n\n<div class="col-xs-6">\n    <div>\n        <span>Complexity</span> <small class="pull-right">4/10</small>\n    </div>\n\n\n    <div class="progress progress-small">\n        <div class="progress-bar progress-bar-warning" style="width: 40%;">\n        </div>\n    </div>\n</div>\n\n\n<div class="col-xs-6">\n    <div>\n        <span>Interpretability</span> <small class="pull-right">8/10</small>\n    </div>\n\n\n    <div class="progress progress-small">\n        <div class="progress-bar" style="width: 80%;">\n        </div>\n    </div>\n</div>');

